import { Box } from "@mui/material"
import TopBar from "components/app_bar/top_bar";
import { SnackbarProvider } from 'notistack'


const Overview = () => {
    return (
        <Box sx={{
            minHeight: "100vh",
            background: "transparent linear-gradient(180deg, #83838300 0%, #4361CF07 26%, #2551F30A 63%, #2450F50A 100%) 0% 0% no-repeat padding-box"
        }}>

          <Box sx={{
            position: "absolute",
            top: 0,
            right: 0
          }}>
            <img src="img/top_right_anchor.svg"/>
          </Box>

          <Box sx={{
            position: "absolute",
            top: 0,
            left: 0
          }}>
            <img src="img/top_left_anchor.svg"/>
          </Box>

          <TopBar/>

        </Box>
    )
}

export default function IntegrationNotistack() {
    return (
      <SnackbarProvider maxSnack={3}>
        <Overview />
      </SnackbarProvider>
    );
  }
